					"view_scope_flag": 0,
					"content": "<p><span><strong>イベントの喧騒の中、フーンは隅で静かにグラスを傾けていた。</strong>弾ける炭酸の音が小さく響き、冷たさが喉を通るたびに少しだけ心が落ち着く。周囲の笑い声は遠く感じられ、自分だけが取り残されているような気がした。<br><br>視線を向けると、そこにはガーがいた。紫色のボードを掲げ、眩しい笑顔でカメラに応じている。周りの人々が自然に彼女の笑顔に引き寄せられるのを見て、フーンは胸の奥で小さな憧れを覚えた。「私もあんなふうに笑えたら…」そう思いながらも、視線を伏せる。</span></p><p><span s7-link-guide-attr=\"s7-link\" s7-link-uid=\"link-c1cb2d0b-beca-4e91-8c1d-ff6f0403f809\" class=\"s7-link-guide-attr-class\">テキスト。</span></p>",
